import React from "react";
import { Switch, Route } from "react-router-dom";


function MainRoute() {
    return(
        <div className="">
            <Switch>
                <Route path="/main/cashCharge">머니 충전</Route>
                <Route path="/main/cashPay">머니 결제</Route>
                <Route path="/main/cashHistory">거래내역</Route>
            </Switch>
        </div>
    )
}

export default MainRoute;
